//hiiiii
//hola
//toggles for: intake, outtake, stop intaking, descore
//wait for xx seconds, choose height level, hoard, descore, slew
//tba perchance pizza lid
//menu for each point

//import React from "react";

function Subsystems({ point, updatePoint }) {
  if (!point) return <p>Right-click a point to edit.</p>;

  return (
    <div>
      <h3>Subsystem Actions</h3>
      <label>
        Intake
        <input
          type="checkbox"
          checked={point.actions.intake}
          onChange={(e) =>
            updatePoint({
              actions: {
                ...point.actions,
                intake: e.target.checked,
              },
            })
          }
        />
      </label>

      {/* Repeat for outtake, descore, etc. */}
    </div>
  );
}

export default Subsystems;
